 @paulista134  mas o São Paulo foi rebaixado sim em 90 no Paulista.
Estou com 40 anos nessa época eles vendiam até picolé pra dar incentivos aos torcedores a ir no estádio. Chegou até ter 3 mil torcedores no Morumbi. Nessa época, o Palmeiras tinha mais torcida que o São Paulo, depois que o São Paulo ganhou a libertadores e mundial, a torcida do São Paulo passou o Palmeiras. Não adianta pesquisar só no Google, quem viveu essa época sabe.
O que acontece que em 91 fizeram um cruzamento de 2 grupos, um do Verde e outro do amarelo que foi a série B. Onde o São Paulo foi beneficiado e campeão.
